export function DeleteNews(id:number) {
  useEffect(() => {
    // DELETE request using fetch with async/await
    async function deletePost() {
      await fetch("http://localhost:7063/api/deletenews/10", {
        method: "DELETE",
      });
    }

    deletePost();
  }, []);
}
